import React from "react";
import "./StickyBlockBox.css";

function StickyBlockBox(props) {
  const { list } = props;
  return (
    <div>
      {list.map((item, index) => (
        <div className="item" key={index + item}>
          <ul>
            {item.type === "H1" && <li className="font-h1">{item.name}</li>}
            {item.type === "H2" && (
              <span>
                <li className="font-h2">{item.name}</li>
              </span>
            )}
          </ul>
        </div>
      ))}
    </div>
  );
}
export default StickyBlockBox;
